import "./App.css";
import Profile from "./components/Profile";

function AppProfile() {
  return (
    <>
      <Profile
        image="/img/jjangGu.jpeg"
        name="신짱구"
        title="프론트엔드 개발자"
      />
      <Profile image="/img/pengsoo.jpeg" name="펭 수" title="일타 강사" />
      <Profile />
    </>
  );
}

export default AppProfile;
